## Create a Tooltip component

First, we create a Tooltip component that will be used in different places. The Tooltip component will have a title and a content. The title will be the text that will be displayed when the user hovers over the Tooltip. The content will be the text that will be displayed when the user clicks on the Tooltip.
```
import React from 'react';

const Tooltip = ({ title, content }) => {
  return (
    <div className="tooltip">
      <span className="tooltip-title">{title}</span>
      <span className="tooltip-content">{content}</span>
    </div>
  );
};

export default Tooltip;
```
## Create a TooltipContext

Next, we create a TooltipContext that will be used to close the previously opened Tooltip and so on. The TooltipContext will have a state that will be used to store the currently opened Tooltip. The TooltipContext will also have a function that will be used to close the currently opened Tooltip.
```
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipContext, TooltipProvider };
```
## Use the TooltipContext in the Tooltip component

Now, we can use the TooltipContext in the Tooltip component. We will use the TooltipContext to close the previously opened Tooltip and so on.
```
import React, { useContext } from 'react';
import { TooltipContext } from './TooltipContext';

const Tooltip = ({ title, content }) => {
  const { tooltip, closeTooltip } = useContext(TooltipContext);

  return (
    <div className="tooltip">
      <span className="tooltip-title">{title}</span>
      <span className="tooltip-content">{content}</span>
      {tooltip && (
        <button className="tooltip-close" onClick={closeTooltip}>
          Close
        </button>
      )}
    </div>
  );
};

export default Tooltip;
```
## Use the Tooltip component in different places

Now, we can use the Tooltip component in different places. We will use the Tooltip component in the App component.
```
import React from 'react';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <div>
      <Tooltip title="Tooltip 1" content="Content 1" />
      <Tooltip title="Tooltip 2" content="Content 2" />
      <Tooltip title="Tooltip 3" content="Content 3" />
    </div>
  );
};

export default App;
```
## Conclusion

In this article, we have created a Tooltip component that will be used in different places. We have also created a TooltipContext that will be used to close the previously opened Tooltip and so on. We have used the TooltipContext in the Tooltip component. We have also used the Tooltip component in the App component.

