asked Nov 2, 2020 Gavin 15.3k points
Java bytecode is the instruction set for the Java Virtual Machine. It acts similar to an assembler which is an abstraction above the underlying platform that makes the Java code portable. Every hardware architecture has a machine language which is a combination of binary codes that the specific computer's CPU recognizes and differently interprets. When the source code is compiled, it is translated into machine language. However, compiled programs only run on the computer architecture for which they were compiled. This leads to the need for bytecode. It is a highly optimized set of instructions that is designed to be executed by the Java run-time system, which is called the Java Virtual Machine (JVM). That is, in its standard form, the JVM is an interpreter for bytecode. This may come as a bit of a surprise. As you know, most modern languages, such as C++, are designed to be compiled, not interpreted—mostly because of performance concerns. However, the fact that a Java program is executed by a JVM interpreter also helps solve the major problems associated with web-based programs. Here is an example of a java bytecode for a simple program:
